import './Yelp.css';

import yelp from '../../assets/business/yelp.png';

function Yelp({link}) {
    return (
        <div style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
            <img src={yelp} style={{width: '20%', height: 'auto'}}/>
            <a href={link} style={{textDecoration: 'none', color: 'white', fontWeight: 'bold', marginLeft: '10px'}}>open in Yelp</a>
        </div>
    )
}
export default Yelp;
